 /*Monotonic Stack "Next Greater Element" Zero base*/
 vector<int>monotonic_stack(int n,vector<int>&v){
  int sz=v.size();
  vector<int>ans(sz);
  for(int i=0;i<ans.size();i++){
    ans[i]=-1;
  }
  stack<int>s;
  s.push(0);
  int i=1;
  while(i<v.size()){
    while(s.size()!=0&&v[s.top()]<v[i]){
      ans[s.top()]=i;
      s.pop();
    }
    s.push(i);
    i++;
  }
  return ans;
 }
