 /*Kadane max sum of contiguous subarray*/
 ll kadane_max_sum(int n,vector<int>&v){
  ll sum=0,ans=LLONG_MIN;
  for(int i=0;i<n;i++){
    sum+=v[i];
    ans=max(ans,sum);
    sum=max(sum,0ll);
  }
  return ans;
 } 
 /******************************************************************************/
 /*Kadane min sum of contiguous subarray*/
 ll kadane_min_sum(int n,vector<int>&v){
  ll sum=0,ans=LLONG_MAX;
  for(int i=0;i<n;i++){
    sum+=v[i];
    ans=min(ans,sum);
    sum=min(sum,0ll);
  }
  return ans;
 } 
