 /*Seive of eratosthenes*/
 bool composite[n+1];
 void sieve(){
  composite[0]=composite[1]=1;
  for(ll i=2;i<=n/i;i++){
    if(composite[i]!=1){
      for(int j=i*i;j<=n;j+=i){
        composite[j]=1;
      }
    }
  }
 }
