 /*n->number, x->power*/
 int bin_exp(int n,int x){
  int res=1;
  while(x>0){
    if(x%2==1){
      res*=x;
    }
    n*=n;
    x/=2;
  }
  return res;
 }
 /******************************************************************************/
 /* (n*n)->long long,int "%m" */
 int modular_exp(int n,int x,int m){
  int res=1;
  while(x>0){
    if(x%2==1){
      res=(res*n)%m;
    }
    n=(n%m*n%m)%m;
    x/=2;
  }
  return res;
 }
